  \"Cloud-Based Analytics, Store and Query System (CASQUE) for Data-Intensive Scientific
  Processing Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 24,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2015-05-07T01:26:01.916106\",\n\t\"name\": \"cloud-based-analytics-store-and-query-system-casque-for-data-intensive-scientific-processi\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"While it has become apparent that we can
  and will collect data at unprecedented rates thanks to a wide range of high-resolution
  high-throughput sensors, it has also become apparent that we do not have the algorithms
  and tools to satisfactorily analyze Big Data. Cloud computing as an infrastructure
  (e.g., Amazon Web Services), as a platform (e.g., Google Apps), and as a software
  ecosystem (e.g., Hadoop/MapReduce and NoSQL tools) offers a promising compute-and-store
  environment (complementary to supercomputing) to handle the massive amount of data
  created by NASA missions. In this proposal, we will develop a Cloud-based open architecture
  Analytics, Store and QUEry (CASQUE) system for data-intensive scientific computing
  for NASA missions. The architecture and workflow will be tailored for specific NASA
  missions and will be thoroughly tested in large-scale relevant cloud environments.\",\n\t\"license_title\":
